import React, { Component } from 'react'
import Items from './Items'
export class item extends Component {
  render() {
    return (
      <main>
        {this.props.item.map(el =>(
             <Items key={el.id} item={el} />
        ))}

      
      </main>
    )
  }
}

export default item
